import React from 'react'

function Resume() {
  const datas = window.localStorage.getItem('obj')
  const rData = JSON.parse(datas)
  return (
    <div className='container'>

      {/* <div className='row'> */}
        <div className='col-1'>
     Name :-{rData.name} {rData.Lastname}
        </div>

        <div className='col-1'>
        Gmail:-  {rData.Gmail}
        </div>

        <div className='col-1'>
         {rData.Address}
        </div>

        <div className='col-1'>

        {rData.Dateofbirth}
        </div>

        <div className='col-1'>
       {rData.Qualification}
        </div>

        <div className='col-1'>
          {rData.Skills}
        </div>

        <div className='col-1'>
           {rData.Maritalstatus}
        </div>

        <div className='col-1'>
            {rData.Hobbies}
        </div>
      {/* </div> */}

    </div> 
  )
}

export default Resume
